const podcast = () => {
  return (
    <div className='container'>
      <div className='  py-5 '>
        <h2 className='back'><b>Access top podcast directories and get your podcast listened to in all</b> </h2>
      </div>
      <h4 align='center'  >Reach millions of listeners by having your podcast in Apple Podcasts, Spotify, Podcast Index,<br/> Google Podcasts, Amazon Music, Stitcher, iHeartRadio, Overcast,<br/> Castbox, and many more.</h4>

      <img src='https://assets.buzzsprout.com/assets/home/2021/listen-apple-podcasts-d9d1e78d704b1c5cf9d278ea8129a2526ec0c255e7fc9bc9cf94aac6c0f8d137.svg' alt=''/>
    </div>
  );
}

export default podcast;
